import React from "react";
import Head from "next/head";
import Container from "../components/container";
import styles from "../styles/index.module.scss";

const Index = () => {
  return (
    <div>
      <Head>
        <title>Next Project - Home</title>
      </Head>
      <Container>
        <h1>WORK IN PROGRESS</h1>
        <p>(100% logic working + Visual in progress)</p>
        <h3>Hi there, this is a Weather app</h3>
        <p>
          This weather app was completely developed on Next.js using server side
          rendering (SSR).
        </p>
        <p>I created a custom Redux store completely integrated to Next.js server for state management. Packages like: "next-redux-wrapper", "redux-devtools-extension"</p>
        <p>
          I have also added Axios.js to make multiple and simoultaneus http
          requests and fetch data from OpenWeather API (you can use the find
          imput and see the results on the console (I promise a visual solution
          in the short term).
        </p>
      </Container>
    </div>
  );
};

export default Index;
